import React from "react";
import "./App.css";
import { Map, Marker } from "pigeon-maps";





function App() {


  return (
    <div className='App'>
      <Map height={500} defaultCenter={[40.712776 ,-74.005974]} defaultZoom={11}>
        <Marker width={100} anchor={[40.712776 ,-74.005974]} />
      </Map>
    </div>
  );
}

export default App;
